import React from 'react';
import { Link } from 'react-router-dom';

const HomePage = () => (
  <div className="hero">
    <div className="hero-background">
      <img className="hero-image" src="https://pplx-res.cloudinary.com/image/upload/v1757274358/pplx_project_search_images/42bc768e171d68355f7f013100c40c5ba7bd77c5.png" alt="Tesla Hero" />
    </div>
    <div className="hero-content">
      <h1 className="hero-title">Experience the Future of Driving</h1>
      <p className="hero-subtitle">Explore, customize, and order your dream Tesla today.</p>
      <div className="hero-buttons">
        <Link to="/models" className="btn btn--primary">View Models</Link>
        <Link to="/login" className="btn btn--secondary">Sign In</Link>
      </div>
    </div>
  </div>
);

export default HomePage;
